import XCTest
@testable import DadKit

class CharacterTests: XCTestCase {

    override func setUp() {
        Bungie.key = ENV_API_KEY
        Bungie.appId = ""
        Bungie.appVersion = ""
    }

    func test_DecodeCharacterResponse() {
        let data = plaintextResponseExample.data(using: .utf8)!
        let decoder = JSONDecoder()
        decoder.dateDecodingStrategy = .iso8601

        do {
            _ = try decoder.decode(PlayerMetaResponse.self, from: data).Response
        } catch {
            XCTFail(error.localizedDescription)
        }
    }

    func test_DecodedCharacterIsMostRecent() {
        let data = plaintextResponseExample.data(using: .utf8)!
        let decoder = JSONDecoder()
        decoder.dateDecodingStrategy = .iso8601

        do {
            let decodedCharacter = try decoder.decode(PlayerMetaResponse.self, from: data).Response

            let raw = try JSONSerialization.jsonObject(with: data, options: .allowFragments) as! NSDictionary
            let resp = raw["Response"] as! NSDictionary
            let cc = resp["characters"] as! NSDictionary
            let characters = cc["data"] as! [String: NSDictionary]

            let dates = characters.values.map { (character) -> Date in
                let format = DateFormatter()
                format.dateFormat = "yyyy-MM-dd'T'HH:mm:ssZ"
                return format.date(from: character["dateLastPlayed"]! as! String)!
            }

            for date in dates {
                if decodedCharacter.dateLastPlayed < date { XCTFail("The character selected from decoding was not the most recently played character.") }
            }
        } catch {
            XCTFail(error.localizedDescription)
        }
    }

    func test_API_GetPlayerRequestResponds200() {
        let req = Bungie.API.getPlayer(withId: "4611686018468167462", onPlatform: .blizzard).request //WeirdRituals
        let x = expectation(description: "Get Player request responds with 200.")
        let promise = URLSession.shared.dataTask(.promise, with: req).validate()

        promise.done { _ in
            x.fulfill()
        }.catch {
            XCTFail($0.localizedDescription)
            x.fulfill()
        }

        wait(for: [x], timeout: 10)
    }

}

